CREATE TABLE `r_nature_of_case` (
  `Case_NAME` varchar(50) NOT NULL,
  `Case_STAT` enum('Active','Inactive') DEFAULT 'Active',
  UNIQUE KEY `Case_NAME` (`Case_NAME`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

CREATE TABLE `r_stud_org_position` (
  `Stud_NO_REFERENCE` varchar(15) NOT NULL,
  `Stud_POSITION` text NOT NULL,
  KEY `FK_orgpstn_STUD_NO` (`Stud_NO_REFERENCE`) USING BTREE,
  CONSTRAINT `FK_orgpstn_STUD_NO` FOREIGN KEY (`Stud_NO_REFERENCE`) REFERENCES `r_stud_profile` (`Stud_NO`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;
